  \"Oceanographic and surface meteorological data collected from station apachepier
  by Long Bay Hypoxia Monitoring Consortium (LBHMC) and assembled by Southeast Coastal
  Ocean Observing Regional Association (SECOORA) in the North Atlantic Ocean from
  2014-02-13 to 2015-07-09 (NODC Accession 0118794)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:15:58.336941\",\n\t\"name\": \"oceanographic-and-surface-meteorological-data-collected-from-station-apachepier-by-long-ba\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Accession 0118794 contains oceanographic
  and surface meteorological data in netCDF formatted files, which follow the Climate
  and Forecast metadata convention (CF) and the Attribute Convention for Data Discovery
  (ACDD). LBHMC collected the data from their in-situ moored station named apachepier
  in the North Atlantic Ocean. SECOORA, which assembles data from LBHMC and other
  sub-regional coastal and ocean observing systems of the southeast United States,
  submitted the data to NCEI as part of NCEI's Integrated Ocean Observing System Data
  Assembly Centers (IOOS DACs) Data Stewardship Program. Each month, NCEI adds to
  the Accession the data collected during the previous month.\",\n\t\"license_title\":
